/**
 * Utility function that swaps two items in array
 * @param  {Array} arr
 * @param  {Integer} a
 * @param  {Integer} b
 * @return {Array}
 */
export function swap(arr, a, b) {
  let tmp = arr[a];
  arr[a]= arr[b];
  arr[b] = tmp;

  return arr;
}

/**
 * Naive bubbleSort
 * @param  {Array} arr
 * @return {Array}
 */
export function bubbleSort(arr) {
  let isSorted = false;

  while (!isSorted) {
    isSorted = true;

    for (let i = 0; i < arr.length - 1; i++) {
      if (arr[i] > arr[i + 1]) {
        swap(arr, i, i + 1);
        isSorted = false;
      }
    }
  }

  return arr;
}

'use strict';

/**
 * Utility function that merges two arrays together
 * @param  {Array} left
 * @param  {Array} right
 * @return {Array}
 */
export function merge(left, right) {
  let il = 0, ir = 0, res = [];

  while (il < left.length && ir < right.length) {
    if (left[il] < right[ir]) {
      res.push(left[il++]);
    } else {
      res.push(right[ir++]);
    }
  }

  return res.concat(left.slice(il)).concat(right.slice(ir));
}

/**
 * Sorts array by dividing it into smaller arrays
 * and recursively calling itself.
 * @param  {Array} items
 * @return {Array}
 */
export function mergeSort(items) {
  if (items.length < 2) {
    return items;
  }

  let middle = Math.floor(items.length / 2);
  let left =  items.slice(0, middle);
  let right = items.slice(middle);

  return merge(mergeSort(left), mergeSort(right));
}

