 * @param  {any} initial — the value to be populated
 * @return {array} - array of arrays
 */
export function createMatrix(numrows, numcols, initial) {
  let res = [];

  for (let i = 0; i < numrows; i++) {
    let row = [];
    for (let j = 0; j < numcols; j++) {
      row.push(initial);
    }
    res.push(row);
  }

  return res;
}

