/**
 * Linked list is efficient data structure that doesn't reply
 * on array under the hood
 */
export class LinkedList {
  /**
   * Linked list instance
   * @return {object} objext with 'head' property
   */
  constructor() {
    this.head = new Node('head');

    this.find = this.find.bind(this);
  }

  /**
   * find node in linked list
   * @param  {objext} node - objext to find
   * @return {node|null}
   */
  find(node) {
    let currentNode = this.head;

    while (currentNode !== node) {
      currentNode = currentNode.next;
    }

    return currentNode;
  }

  /**
   * find node before
   * @param  {node} node - a node to find one before
   * @return {node|null}
   */
  findPrevious(node) {
    let currentNode = this.head;

    while (!(currentNode !== null) && currentNode.next.element !== node) {
      currentNode = currentNode.next;
    }

    return currentNode;
  }

  /**
   * Insert element before node
   * @param  {any} el - element to insert
   * @param  {node} node - a node to insert after
   * @return {void}
   */
  insert(el, node) {
    let newNode = new Node(el);
    let currentNode = this.find(node);

    newNode.next = currentNode.next;
    currentNode.next = newNode;
  }

  /**
   * remove node
   * @param  {node} node
   * @return {noid}
   */
  remove(node) {
    let prev = this.findPrevious(node);
    if (!(prev.next !== null)) {
      prev.next = node.next.next;
    }
  }
}

/**
 * List data structure.
 * let list = new List([1,2,3])
 */
export class List {
  /**
   * creates instance of list
   * @param  {array} items - array of items to be place into the list
   * @return {List}
   */
  constructor(items) {
    if (!Array.isArray(items)) throw Error('Provide a valid array');

    /**
     * @private store
     * @type {array}
     */
    let store = items;

    /**
     * we store current element index in this variable
     * @private index
     * @type {number}
     */
    let index = 0;

    /**
     * @return {String} returns stringified representation
     * of the content of list
     */
    this.toString = () => {
      return store.toString();
    };

    /**
     * @return {Number} return index of current item
     */
    this.current = () => {
      return store[index];
    };

    /**
     * @return {Number}
     */
    this.next = () => {
      return store[index++];
    };

    /**
     * @return {Number}
     */
    this.prev = () => {
      return store[++index];
    };

    /**
     * set the index to the first element of list
     * @return {void}
     */
    this.front = () => {
      index = 0;
    };

    /**
     * set the index to the last element of list
     * @return {void}
     */
    this.end = () => {
      index = store.length - 1;
    };

    /**
     * @param {any} el - element to be inserted
     * @param {number} ix - index to append element to
     */
    this.insert = (el, ix) => {
      store.splice(ix - 1, 1, el);
    };

    /**
     * @param {any} el - finds and returns element if it exists in the list
     * @return {Number} returns index of provided element
     */
    this.find = el => {
      let ix = store.indexOf(el);

      if (ix > 0) {
        return store[ix];
      } else {
        return false;
      }
    };

    /**
     * @param {any} el - remove element if it exists in the list
     * @return {Number} returns index of removed element
     */
    this.remove = el => {
      let ix = store.indexOf(el);

      if (ix > 0) {
        store.splice(ix, 1);
      } else {
        return false;
      }
    };

    /**
     * checks in item exists in list
     * @param  {any} el - item to check
     * @return {boolean}
     */
    this.contains = el => {
      // TODO reimplemet with .deepEqual()
      return store.indexOf(el) > 0;
    };

    /**
     * clear list instance
     * @return {void}
     */
    this.clear = () => {
      store = [];
    };
  }
}

/**
 * Deeply clones object obj !== cloneObject(obj)
 * @param {Object} obj
 * @return {Object}
 */
export function cloneObject(obj) {
  if (typeof obj !== 'object') throw Error('Not valid object');

  let res = {};

  for (let prop in obj) {
    if (obj.hasOwnProperty(prop)) {
      res[prop] = obj[prop];
    }
  }

  return res;
}

/**
 * A queue is a first-in, first-out (FIFO) data structure
 */
export class Queue {
  /**
   * creates instance of queue
   * @return {queue}
   */
  constructor() {
    let store = [];

    /**
     * add item to tail of queue
     * @param  {any} el
     * @return {void}
     */
    this.enqueue = el => {
      store.push(el);
    };

    /**
     * return item from the head of queue
     * @return {any}
     */
    this.dequeue  = () => {
      return store.shift();
    };

    /**
     * string representation the contents of queue
     * @return {string}
     */
    this.toString = () => {
      return store.toString();
    };

    /**
     * first item in queue
     * @return {any}
     */
    this.head = () => {
      return store[0];
    };

    /**
     * last item of queue
     * @return {any}
     */
    this.tail = () => {
      return store[store.length];
    };

    /**
     * returns true if no items persists in store
     * @return {boolean}
     */
    this.empty = () => {
      return store.length === 0;
    };
  }
}

