/**
 * Seq represents a possibly endless sequence of entities
 */
export class Seq {
  /**
   * creates instance of Seq
   * @param  {array} values - accepts array of values
   * @return {Seq}
   */
  constructor(values) {
    if (!Array.isArray(values)) throw Error('Provide valid array');
    this.values = values;
    this._index = 0;
  }

  /**
   * @return {Any} item of sequence with current index
   */
  get current() {
    return this.values[this._index];
  }

  /**
   * @return {Number} Sets current item to @param
   */
  set current(val) {
    this._index = val;
  }

  /**
   * @return {Any}
   */
  next() {
    return this.values[++this._index];
  }

  /**
   * @return {Any}
   */
  first() {
    return this.values[0];
  }

  /**
   * @return {Any}
   */
  last() {
    return this.values[this.values.length - 1];
  }

  /**
   * @return {Any}
   */
  nth(n) {
    return this.values[n - 1];
  }
}

import { Stack } from './stack.js';

/**
 * convert number to base
 * @param  {number} n - a number to convert
 * @param  {number} base - a base to convert to
 * @return {stack}
 */
export function toBase(n, base) {
  let stack = new Stack();

  while (n > 0) {
    stack.add(n % base);
    n = Math.floor(n /= base);
  }

  return stack.toString().replace(/,/g, '');
}

/**
 * factorial of given number using stack
 * @param  {number} n
 * @return {number}
 */
export function factorial(n) {
  let res = 1;
  let stack = new Stack();

  while (n > 0) {
    stack.add(n--);
  }

  while (stack.size() > 0) {
    res *= stack.next();
  }

  return res;
}

/**
 * Validates the number of parens (it should be even) and begin with '('
 * @param  {string} str
 * @return {boolean}
 */
export function parensValidator(str) {
  let stack = new Stack();
  // indicates closing parens
  let flag = false;

  for (let i = 0; i < str.length; i++) {
    if (str[i] === ')' && !flag) {
      return false;
    } else if (str[i] === '(') {
      flag = true;
      stack.add(i);
    } else if (str[i] === ')') {
      stack.next();
    }
  }

  return stack.size() % 2 === 0;
}

/**
 * Stack, aka "last-in, first-out (LIFO) data structure"
 */
export class Stack {
  /**
   * creates empty stack instance
   * @return {stack}
   */
  constructor() {
    /**
     * private storage of the stack re
     * @type {Array}
     */
    let store = [];

    /**
     * add item on top of stack
     * @param  {any} el
     * @return {void}
     */
    this.add = el => {
      store.push(el);
    };

    /**
     * return top item of the stack
     * @return {any}
     */
    this.next = () => {
      if (store.length > 0) {
        return store.pop();
      } else {
        return false;
      }
    };

    /**
     * peek returns last item without removing it
     * @return {any}
     */
    this.peek = () => {
      return store[store.length - 1];
    };

    /**
     * size of stack
     * @return {number}
     */
    this.size = () => {
      return store.length;
    };

    /**
     * serialize stack to string
     * @return {string}
     */
    this.toString = () => {
      return store.toString();
    };
  }
}
